  //script.setAttribute("data-dLayer-name", "OTDataLayer");\n  document.head.appendChild(script);\n  \n}());\n\n/**\n * @file DHLTrackingHelper.js\n * @description This file contains functions related to tracking and analytics for DHL tracking.\n * The functions include sending data via image pixel, appending scripts asynchronously,\n * loading and initializing meta pixel, tracking meta pixel, loading and initializing Google (Ads) Tag,\n * tracking Google Ads conversion, loading and initializing LinkedIn Insights Tag, and tracking LinkedIn Insights Tag conversion.\n * These functions are part of the DHLTrackingHelper namespace.\n */\nwindow.DHLTrackingHelper = {};\n\n// src/utilities.js\n// src/vendors/meta.js\n// src/vendors/google.js\n// src/vendors/linkedin.js\n// src/vendors/naver.js\n// src/vendors/kakao.js\n/*\n * Function to send data via an image pixel\n * @param {string} pixelUrl URL that will be requested via image pixel\n */\nwindow.DHLTrackingHelper._sendImagePixel = function (pixelUrl) {\n    var imageTag;\n\n    imageTag = document.createElement("img");\n    imageTag.width = 1;\n    imageTag.height = 1;\n    imageTag.style.display = "none";\n    imageTag.src = pixelUrl;\n};\n\n/*\n * Function to append a script to a page asynchronously\n * @param {string} scriptUrl URL of the JavaScript file that will be appended to the page\n * @param {function} callback optional callback function to trigger onload\n */\nwindow.DHLTrackingHelper._requestAsyncScript = function (scriptUrl, callback) {\n    var scriptTag,\n        firstScript;\n\n    scriptTag = document.createElement("script");\n    firstScript = document.getElementsByTagName("script")[0];\n    scriptTag.type = "text/javascript";\n    scriptTag.onload = callback;\n    scriptTag.async = !0;\n    scriptTag.src = scriptUrl;\n    firstScript.parentNode.insertBefore(scriptTag, firstScript);\n};\n\n/*\n * Function to load Google (Ads) Tag\n * @param {string} accountId ID of the Google Tag\n */\nwindow.DHLTrackingHelper.loadGoogleTag = function (accountId) {\n    if (!window.DHLTrackingHelper.googleTagLoaded) {\n        var googleTagUrl = "https://www.googletagmanager.com/gtag/js?id=" + accountId + "&l=gtagDataLayer";\n\n        this._requestAsyncScript(googleTagUrl, function () {\n            window.DHLTrackingHelper.googleTagLoaded = !0;\n            _satellite.logger.log("Google Tag loaded - ID: " + accountId);\n        });\n    }\n};\n\n/*\n * Function to initialize Google (Ads) Tag\n * @param {string} accountId ID of the Google Solution\n * @param {string} service ID of the particular Google Service: AW for Ads, DC for Floodlight, etc.\n */\nwindow.DHLTrackingHelper.initializeGoogleTag = function (accountId, service) {\n    var account = (service || "AW") + "-" + accountId;\n\n    if (!window.DHLTrackingHelper.googleTagInitialized) {\n        window.gtagDataLayer = window.gtagDataLayer || [];\n        window.gtag = function () {\n            window.gtagDataLayer.push(arguments);\n        };\n        gtag("js", new Date());\n        window.DHLTrackingHelper.googleTagInitialized = !0;\n    }\n    window.DHLTrackingHelper.googleTagAccountsInitialized = window.DHLTrackingHelper.googleTagAccountsInitialized || [];\n    if (!window.DHLTrackingHelper.googleTagAccountsInitialized[account]) {\n        gtag("config", account);\n        window.DHLTrackingHelper.googleTagAccountsInitialized[account] = !0;\n        _satellite.logger.log("Google Tag Account Initialized: " + account);\n    }\n    if (!window.DHLTrackingHelper.googleTagLoaded) {\n        this.loadGoogleTag(account);\n    }\n};\n\n/*\n * Function to track Google Ads Conversion\n * @param {string} accountId ID of the Google Tag\n * @param {string} conversionId ID of the specific conversion\n * @param {string} redirectUrl optional URL to redirect to after the conversion has been tracked\n */\nwindow.DHLTrackingHelper.trackGoogleAdsConversion = function (accountId, conversionId, redirectUrl) {\n    if (!window.DHLTrackingHelper.googleTagInitialized) {\n        this.initializeGoogleTag(accountId);\n    }\n    if (typeof conversionId !== "undefined") {\n        gtag("event", "conversion", {\n            send_to: "AW-" + accountId + "/" + conversionId,\n            event_callback: function () {\n                "undefined" != typeof redirectUrl && (window.location = redirectUrl)\n            }\n        });\n        _satellite.logger.log("Google Ads Conversion tracked - ID: " + accountId + " | Label : " + conversionId);\n    }\n};\n\n/*\n * Function to track Floodlight Activity\n * @param {string} accountId ID of the Google Tag\n * @param {string} conversionId ID of the specific conversion\n * @param {string} redirectUrl optional URL to redirect to after the conversion has been tracked\n */\nwindow.DHLTrackingHelper.trackGoogleFloodlightActivity = function (accountId, groupTag, activityTag) {\n    if (!window.DHLTrackingHelper.googleTagAccountsInitialized["DC-" + accountId]) {\n        this.initializeGoogleTag(accountId, "DC");\n    }\n    if (typeof groupTag !== "undefined" || typeof activityTag !== "undefined") {\n        gtag("event", "conversion", {\n            allow_custom_scripts: true,\n            send_to: "DC-" + accountId + "/" + groupTag + "/" + activityTag + "+standard"\n        });\n        _satellite.logger.log("Floodlight Activity tracked - ID: " + accountId + " | Group/Activity : " + groupTag + "/" + activityTag);\n    }\n};\n\n/*\n * Function to track Google Floodlight Activity via image tag\n * @param {string} accountId ID of the Google Tag\n * @param {string} type type of the event\n * @param {string} category category of the event\n */\nwindow.DHLTrackingHelper.trackGoogleFloodlightActivityNoscript = function (accountId, type, category) {\n    var pixelUrl = "https://ad.doubleclick.net/ddm/activity/";\n    pixelUrl += "src=" + accountId + ";";\n    pixelUrl += "type=" + type + ";";\n    pixelUrl += "cat=" + category + ";";\n    pixelUrl += "dc_lat=;dc_rdid=;tag_f